import React from 'react';
import { createBottomTabNavigator } from 'react-navigation-tabs';
import restaurantes from './screens/Restaurantes';
import home from './screens/Home';
import { NavigationContainer } from '@react-navigation/native';
import { StatusBar } from 'expo-status-bar';
var imgVegifruit = require('./assets/vegifruit.png');
var imgGreenCity = require('./assets/greencity.png');
var imgSaladasmais = require('./assets/saladasmais.jpg');

export const restaurants = {
  "Vegifruit": {
    "id": 0,
    "PricePoint": "€",
    "Address": "Rua de São Sebastião, 122 3810 - 187 Aveiro",
    "Tags": ["Vegan", "Saladas", "Biologico"],
    "Pratos": {
      "Salada de queijo da serra ": { "Preço": 7, "Opçoes": ["Extra azeitonas"] }
    },
    "image": imgVegifruit,
  },
  "Green City quiches & saladas, co.": {
    "id": 1,
    "PricePoint": "€",
    "Address": "R. de Castro Matoso 28 A, 3810-079 Aveiro",
    "Tags": ["Vegan", "Saladas", "Quiches", "Biologico"],
    "Pratos": {
      "Quiche especial": { "Preço": 6, "Opçoes": ["Tamanho grande"] }
    },
    "image": imgGreenCity,
  },
  "Saladas+": {
    "id": 2,
    "PricePoint": "€",
    "Address": "R. de São Sebastião 31, 3810-187 Aveiro",
    "Tags": ["Vegan", "Saladas", , "Biologico"],
    "Pratos": {
      "Salada Especial": { "Preço": 5, "Opçoes": ["Extra tomate"] }
    },
    "image": imgSaladasmais,
  },
}


const TabNav = createBottomTabNavigator();
export default function App() {
  return(
    <View>
      <StatusBar style={"auto"}/>
      <NavigationContainer>
        <Tab.Navigator initialroute="Home">
          <Tab.Screen name="Home" component={home} />
          <Tab.Screen name="Restaurantes" component={restaurantes} />
        </Tab.Navigator>
      </NavigationContainer>
    </View>

  );
}
